import React from 'react';


const NewUsers = (props) => {
    return (
        <div>
            {
                props.users.map(u => <div key={u.id}> <img src='#' alt='#'/> 
                    <div>u.fullName</div>

                </div>)
            }
        </div>
    );
}
export default NewUsers;
